import React from "react";
// importing Link from react-router-dom to navigate to
// different end points.
import { Link } from "react-router-dom";

const Home = () => {
return (
	<div>
	<h1>Home Page</h1>
		<p><Link to="/">Home</Link></p>
	</div>
);
};

export default Home;
